window.bookSummaryJSON = "<p>Sydney spent his time playing all the real-time strategy games that he could get his hands on. While in the middle of one of the biggest games of his life the world seemed to come to an end. Waking up in a strange world as something called a Dungeon Core with more than a few things around him that would be happy to kill him, he begins work on building his defenses while learning about the world. Luckily for him, his new form's abilities happens to be exactly like the strategy games he loved back on Earth. He was a pro then, he would be a pro again.</p>"; 
